Sure, here's my attempt at drawing the line and helicopter using `processing`:

```processing
void setup() {
  size(400, 400);
}

void draw() {
  background(255);

  // Draw the line
  stroke(0);
  strokeWeight(2);
  line(0, height/2, width, height/2);

  // Draw the helicopter
  stroke(0);
  strokeWeight(1);
  fill(255, 0, 0);

  // Draw the body of the helicopter
  beginShape();
  vertex(100, 200);
  vertex(150, 150);
  vertex(250, 150);
  vertex(300, 200);
  vertex(250, 250);
  vertex(150, 250);
  endShape(CLOSE);

  // Draw the tail rotor
  fill(0);
  rect(90, 190, 20, 20);
  triangle(80, 200, 90, 200, 90, 190);

  // Draw the main rotor
  fill(0);
  ellipse(200, 150, 100, 100);
  for (int i = 0; i < 3; i++) {
    pushMatrix();
    translate(200, 150);
    rotate(radians(frameCount * 5 + i * 120));
    rect(0, -40, 10, 80);
    popMatrix();
  }
}
```

This code should draw a black line across the middle of the screen and a red helicopter in the center. The helicopter has a body with six vertices, a tail rotor, and a main rotor with three blades that rotate around its center. Note that I did use the `translate` and `rotate` functions to draw the blades of the main rotor, but I did not define any custom transformation functions.

